}

private static boolean endsWith(final java.lang.CharSequence input, final java.lang.CharSequence suffix) {
    if ((input.length()) > (suffix.length())) {
        {
            if ((suffix.length()) > (input.length())) {
                return false;
            } 
            for (int int = (input.length()) - 1, int int = (suffix.length()) - 1 ; j >= 0 ; i-- , j--) {
                if ((input.charAt(i)) != (suffix.charAt(j))) {
                    return false;
                } 
            }
            return true;
        }
    } else {
        throw new java.lang.RuntimeException();
    }
}

